public class InnerSpaceSpaceSettingsFactory(Action<Humidifier.SageMaker.SpaceTypes.SpaceSettings> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.SpaceTypes.SpaceSettings>
{

    internal InnerSpaceSpaceJupyterLabAppSettingsFactory JupyterLabAppSettingsFactory { get; set; }

    internal InnerSpaceKernelGatewayAppSettingsFactory KernelGatewayAppSettingsFactory { get; set; }

    internal InnerSpaceSpaceCodeEditorAppSettingsFactory CodeEditorAppSettingsFactory { get; set; }

    internal InnerSpaceJupyterServerAppSettingsFactory JupyterServerAppSettingsFactory { get; set; }

    internal InnerSpaceSpaceStorageSettingsFactory SpaceStorageSettingsFactory { get; set; }

    protected override Humidifier.SageMaker.SpaceTypes.SpaceSettings Create()
    {
        var spaceSettingsResult = CreateSpaceSettings();
        factoryAction?.Invoke(spaceSettingsResult);

        return spaceSettingsResult;
    }

    private Humidifier.SageMaker.SpaceTypes.SpaceSettings CreateSpaceSettings()
    {
        var spaceSettingsResult = new Humidifier.SageMaker.SpaceTypes.SpaceSettings();

        return spaceSettingsResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.SpaceTypes.SpaceSettings result)
    {
        base.CreateChildren(result);

        result.JupyterLabAppSettings ??= JupyterLabAppSettingsFactory?.Build();
        result.KernelGatewayAppSettings ??= KernelGatewayAppSettingsFactory?.Build();
        result.CodeEditorAppSettings ??= CodeEditorAppSettingsFactory?.Build();
        result.JupyterServerAppSettings ??= JupyterServerAppSettingsFactory?.Build();
        result.SpaceStorageSettings ??= SpaceStorageSettingsFactory?.Build();
    }

} // End Of Class

